import React, { useState, useEffect } from 'react';
import './Meeting.scss';

const Meeting = () => {
  const [muted, setMuted] = useState<Boolean>(false);
  const [videoOn, setVideoOn] = useState<Boolean>(true);
  const [sharing, setSharing] = useState<Boolean>(false);

  const handleClick = (event: any) => {
    // endCall
  };

  return (
    <div className="mtngcontainer">
      <div>
        {muted ? (
          <button className="btn-off">
            <img src={require('../../assets/microphone.svg')} />
          </button>
        ) : (
          <button className="btn-on">
            <img src={require('../../assets/microphone-slash.svg')} />
          </button>
        )}
        <button className="phnbtn" onClick={handleClick}>
          <img src={require('../../assets/phone-alt.svg')} />
        </button>
        {videoOn ? (
          <button className="btn-on">
            <img src={require('../../assets/video.svg')} />
          </button>
        ) : (
          <button className="btn-off">
            <img src={require('../../assets/video-slash.svg')} />
          </button>
        )}
        {sharing ? (
          <button className="share-on">
            <img src={require('../../assets/monitor.svg')} />
            Share Screen
          </button>
        ) : (
          <button className="share-off">
            <img src={require('../../assets/monitor.svg')} />
          </button>
        )}
      </div>
    </div>
  );
};

export default Meeting;
